    of California from 2015-05-16 to 2015-06-03. These data include CONDUCTIVITY, SALINITY
    and WATER TEMPERATURE. The instruments used to collect these data include CTD. These
    data were collected by Brad Seibel of The University of Rhode Island, and by Woods
    Hole Oceanographic Institution as part of Ocean Acidification: Oxygen-limited CO2
